import React from 'react';
import "./skills.css";

const Skills = () => {
    return (
        <div className="s">
            <div className="s-left">
                <div className="s-bg">

                </div>
                <div className="s-left-wrapper"></div>
                <div className="s-texts">
                    <h1 className="s-title">
                        My Skills
                    </h1>
                    <p className="s-desc">
                        Basically as a learner, I've gained a solid understanding of computer science and web development concepts, and have dedicated a lot of my free time to apply these concepts to real-world scenarios and applications.
                    </p>
                </div>
            </div>
            <div className="s-right">
            <div className="i-img"><CarouselContainer /></div>

            </div>
        </div>
    );
};

export default Skills;
